import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Line from "./Line";
import Pie from "./Pie";
import Polar from "./Polar";
import Bar from "./Bar";

function App() {
  return (
    <div className="App">
      <Polar />
      <Pie />
      <Line />
      <Bar />
    </div>
  );
}

export default App;
